Storyline:

    Prudence (Claudette Colbert) travels to an isolated Texas town where she has inherited the local paper. She finds the place ruled over by the two men who wrested the area from the Indians twenty-five years before, and it is clear they do not welcome her free-spirited intervention. Support comes in the unexpected shape of the gambler she has just bested in New Orleans for her own family reasons.



